    var recipes = [helmRecipes,armorRecipes,shoesRecipes,shieldRecipes,swordRecipes,axeRecipes,maceRecipes,glovesRecipes,crossbowRecipes,hammerRecipes]

    var itemmap = new Item_Map()
//enchant4
    async function updateTable(){
      updateButtonTextUpdating()
      itemmap.clearMap()
      updateItemMap(itemmap,appendItems([materials, fey, t1tot3])).then(x => updateItemMap(itemmap, artefact)).then(x => updateItemMap(itemmap, enchant4)).then(x => updateItemMap(itemmap, weapon3))
      .then(x => updateItemMap(itemmap, appendItems([armor1,offhand])))
      .then(x => updateItemMap(itemmap, appendItems([armor2,weapon3]))).then(x => updateItemMap(itemmap, weapon1)).then(x => updateItemMap(itemmap, weapon2))
      .then(x => updateTableValues()).then(x => updateButtonTextUpdated())
    }

    async function updateTableValues(){
      createTableFromRecipesDifferentEnd(recipes[$("#category").val()], itemmap)
      updateProfit()
      changeProfitColor()
      showOnlyEnchant($("#enchantLevel").val())
      bindSelectRow()
    }

    $(document).ready(function(){
      createNavBar()
      updateTable()
      $("#category").change(function() { updateTableValues() })
      $("#quality").change(function() { updateTableValues() })
      $("#enchantLevel").change(function() { updateTableValues() })
      $("#locations").change(function() { updateTableValues() })
      $("#endLocations").change(function() { updateTableValues() })
      $("#language").change(function() { updateTableValues() })
      $("#server").change(function() { updateTable() })
    })